import styled from "styled-components";

export const DivForm = styled.div`
  margin: 0;
  border: solid;
  border-radius: 10px;

  display: flex;
  flex-direction: column;

  width: 22%;
  height: 502px;

  background-color: #212529;
  color: white;

  form {
    display: flex;
    flex-direction: column;
  }

  input {
    background-color: #343b41;
    border-radius: 5px;
    border: none;
    width: 78.2%;
    height: 48px;
  }
`;
